    false,nt"url": null,nt"notes": "The proposed project is to eradicate phragmites
    (Phragmites australis) and Russian olive (Elaeagnus angustifolia) from patches in
    100 acres within Marsh Unit 3 at Columbia NWR prior to a riparian restoration project
    along Crab Creek. Phragmites is a class B noxious weed in Washington. It forms dense,
    monotypic stands within wetlands, displaces native plants, and disrupts wetland
    functions. Russian olive also forms dense stands and displaces native plants, such
    as willow and cottonwood. While spot treatment of problematic patches of both species
    within wetland impoundments is typical annual control, the proposed treatment is
    a focused effort to eradicate both species within an entire management unit of Columbia
    NWR. The planned riparian restoration project will reduce access to some areas,
    so eradication prior to the project is ideal.",nt"license_title": "License
